char* copyString(const char *source) {
  size_t len = strlen(source);
  char *copy = malloc(len+1);
  strcpy(copy, source);
  return copy;
}

// EMSCRIPTEN_KEEPALIVE
const char* scanImage(void *data, unsigned int width, unsigned int height) {
  zbar_image_scanner_t *scanner = zbar_image_scanner_create();
  zbar_image_scanner_set_config(scanner, 0, ZBAR_CFG_ENABLE, 1);

  zbar_image_t *img = zbar_image_create();
  zbar_image_set_size(img, width, height);
  zbar_image_set_format(img, *(unsigned long*)"Y800");
  zbar_image_set_data(img, data, width * height, NULL);

  int n = zbar_scan_image(scanner, img);

  if (n <= 0) {
    return "no result";
  }
  const zbar_symbol_t *sym = zbar_image_first_symbol(img);
  const char* result = copyString(
          zbar_symbol_get_data(sym)
  );

  zbar_image_destroy(img);
  zbar_image_scanner_destroy(scanner);

  return result;
}

